import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";

contract Wrap {
    address public mz;

    IERC20 public usdt;

    constructor(address mz_, IERC20 usdt_) {
        mz = mz_;
        usdt = usdt_;
    }

    function withdraw() external {
        uint256 usdtBalance = usdt.balanceOf(address(this));
        if (usdtBalance > 0) {
            usdt.transfer(mz, usdtBalance);
        }
    }
}

abstract contract ERC20Detailed is IERC20 {
    string private _name;

    string private _symbol;

    uint8 private _decimals = 18;

    constructor(string memory name_, string memory symbol_) {
        _name = name_;
        _symbol = symbol_;
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }
}

contract MZ is ERC20Detailed, Ownable {
    using SafeMath for uint256;
    using Address for address;

    uint256 public constant VALID_REQUIRE = 500 * 1e18;
    address public constant DEAD = 0x000000000000000000000000000000000000dEaD;
    uint256 constant NO_FEE_REQUIREMENT = 310000;

    Wrap public immutable wrap;

    uint256 private immutable TOTAL_GONS;
    uint256 private constant MAX_UINT256 = type(uint256).max;
    uint256 public immutable MAX_SUPPLY;

    uint256 public immutable lpFeeRate = 5;

    uint256 public immutable extraFeeRate = 240;

    uint256 public immutable burnFeeRate = 15;

    uint256 public immutable transferBurnFeeRate = 70;

    address public extraWallet;

    address public sellBurnWallet;

    address public buyBurnWallet;

    uint256[9] public referralFeeRates = [10, 5, 5, 4, 2, 4, 5, 5, 10];

    uint256 public gonsLpFee;

    IUniswapV2Router02 public immutable pancakeSwapRouter;
    IERC20 public immutable usdt;
    address public immutable pair;

    uint256 public immutable tradeStartTime;
    uint256 public immutable maxHoldings = 2000 * 1e18;
    uint256 public swapInterval = 1 hours;
    uint256 private _lastSwapTime;
    bool private _swapping = false;
    uint256 public immutable rebaseInterval = 15 minutes;
    uint256 public immutable rebaseRate = 103654651492685;
    uint256 private _lastRebasedTime;
    uint256 private _totalSupply;
    uint256 private _gonsPerFragment;

    uint256 private _pairBalance;
    mapping(address => uint256) private _gonsBalances;
    mapping(address => mapping(address => uint256)) private _allowedFragments;
    mapping(address => bool) private _isExcludedFromFees;

    mapping(address => uint256) private _referralCounts;
    mapping(address => uint256) private _validReferralCounts;
    mapping(address => bool) private _isValids;
    mapping(address => bool) private _isHolders;
    mapping(address => address) private _referrals;
    address public immutable rootAddress;
    mapping(address => address) private _wReferrals;

    uint256 public holderCount;

    modifier validRecipient(address to) {
        require(to != address(0x0));
        _;
    }

    constructor(
        string memory name_,
        string memory symbol_,
        uint256 initSupply_,
        uint256 maxSupply_,
        IUniswapV2Router02 pancakeSwapRouter_,
        IERC20 usdt_,
        address rootAddress_,
        address extraWallet_,
        address buyBurnWallet_,
        address sellBurnWallet_,
        uint256 tradeStartTime_
    ) ERC20Detailed(name_, symbol_) {
        extraWallet = extraWallet_;
        buyBurnWallet = buyBurnWallet_;
        sellBurnWallet = sellBurnWallet_;
        tradeStartTime = _lastRebasedTime = _lastSwapTime = tradeStartTime_;
        rootAddress = rootAddress_;
        pancakeSwapRouter = pancakeSwapRouter_;
        usdt = usdt_;
        wrap = new Wrap(address(this), usdt);
        pair = IUniswapV2Factory(pancakeSwapRouter.factory()).createPair(
            address(usdt),
            address(this)
        );
        _totalSupply = initSupply_ * 10 ** decimals();
        MAX_SUPPLY = maxSupply_ * 10 ** decimals();
        TOTAL_GONS = MAX_UINT256 / 1e10 - ((MAX_UINT256 / 1e10) % _totalSupply);
        _gonsPerFragment = TOTAL_GONS.div(_totalSupply);
        _gonsBalances[msg.sender] = TOTAL_GONS;
        emit Transfer(address(0x0), msg.sender, _totalSupply);
        _allowedFragments[address(this)][
            address(pancakeSwapRouter)
        ] = MAX_UINT256;
        usdt.approve(address(pancakeSwapRouter), MAX_UINT256);
        excludeFromFees(address(this), true);
        excludeFromFees(DEAD, true);
        excludeFromFees(owner(), true);
        excludeFromFees(rootAddress, true);
        excludeFromFees(extraWallet, true);
        excludeFromFees(buyBurnWallet, true);
        excludeFromFees(sellBurnWallet, true);
    }

    function _isGtMaxHoldings(
        address _from,
        address _to
    ) private view returns (bool) {
        return
            block.timestamp < tradeStartTime.add(30 minutes) &&
            _to != pair &&
            balanceOf(_to) > maxHoldings &&
            !(_isExcludedFromFees[_to] || _isExcludedFromFees[_from]);
    }

    function isBindParent(address _account) public view returns (bool) {
        return getParent(_account) != address(0) || _account == rootAddress;
    }

    function getParent(address _account) public view returns (address) {
        return _referrals[_account];
    }

    function isExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }

    function referrlCount(address _account) external view returns (uint256) {
        return _referralCounts[_account];
    }

    function validReferralCount(
        address _account
    ) public view returns (uint256) {
        return _validReferralCounts[_account];
    }

    function isValid(address _account) public view returns (bool) {
        return _isValids[_account];
    }

    function transfer(
        address to,
        uint256 value
    ) external override validRecipient(to) returns (bool) {
        _transferFrom(msg.sender, to, value);
        return true;
    }

    function transferFrom(
        address from,
        address to,
        uint256 value
    ) external override validRecipient(to) returns (bool) {
        if (_allowedFragments[from][msg.sender] != MAX_UINT256) {
            _allowedFragments[from][msg.sender] = _allowedFragments[from][
                msg.sender
            ].sub(value, "Insufficient Allowance");
        }
        _transferFrom(from, to, value);
        return true;
    }

    function allowance(
        address owner_,
        address spender
    ) external view override returns (uint256) {
        return _allowedFragments[owner_][spender];
    }

    function decreaseAllowance(
        address spender,
        uint256 subtractedValue
    ) external returns (bool) {
        uint256 oldValue = _allowedFragments[msg.sender][spender];
        if (subtractedValue >= oldValue) {
            _allowedFragments[msg.sender][spender] = 0;
        } else {
            _allowedFragments[msg.sender][spender] = oldValue.sub(
                subtractedValue
            );
        }
        emit Approval(
            msg.sender,
            spender,
            _allowedFragments[msg.sender][spender]
        );
        return true;
    }

    function increaseAllowance(
        address spender,
        uint256 addedValue
    ) external returns (bool) {
        _allowedFragments[msg.sender][spender] = _allowedFragments[msg.sender][
            spender
        ].add(addedValue);
        emit Approval(
            msg.sender,
            spender,
            _allowedFragments[msg.sender][spender]
        );
        return true;
    }

    function approve(
        address spender,
        uint256 value
    ) external override returns (bool) {
        return _approve(msg.sender, spender, value);
    }

    function _approve(
        address sender,
        address spender,
        uint256 value
    ) private returns (bool) {
        _allowedFragments[sender][spender] = value;
        emit Approval(sender, spender, value);
        return true;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address who) public view override returns (uint256) {
        return
            who == pair
                ? _pairBalance
                : _gonsBalances[who].div(_gonsPerFragment);
    }

    function getParents(
        address _address,
        uint256 _num
    ) public view returns (address[] memory) {
        address[] memory result;
        result = new address[](_num);
        for (uint256 i = 0; i < _num; i++) {
            _address = getParent(_address);
            if (_address == address(0)) break;
            result[i] = _address;
        }
        return result;
    }

    function _basicTransfer(
        address from,
        address to,
        uint256 gonAmount
    ) internal returns (bool) {
        uint256 amount = gonAmount.div(_gonsPerFragment);
        if (from == pair) {
            _pairBalance = _pairBalance.sub(amount);
        } else {
            _gonsBalances[from] = _gonsBalances[from].sub(gonAmount);
        }
        if (to == pair) {
            _pairBalance = _pairBalance.add(amount);
        } else {
            _gonsBalances[to] = _gonsBalances[to].add(gonAmount);
        }
        emit Transfer(from, to, amount);
        return true;
    }

    function _transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) internal returns (bool result) {
        if (_swapping) {
            return
                _basicTransfer(sender, recipient, amount.mul(_gonsPerFragment));
        }
        require(_isStartTrade(sender, recipient), "Not start trade");
        if (!_isTrade(sender, recipient) && !recipient.isContract()) {
            _referral(sender, recipient);
            _acceptReferral(sender, recipient);
        }

        if (_shouldRebase()) {
            _rebase();
        }

        if (_shouldSwap(sender, recipient)) {
            _swap();
        }

        uint256 gonAmount = amount.mul(_gonsPerFragment);
        if (_shouldTakeFee(sender, recipient)) {
            gonAmount = _takeFee(sender, recipient, gonAmount);
        }
        result = _basicTransfer(sender, recipient, gonAmount);
        require(!_isGtMaxHoldings(sender, recipient), "GT max holdings");
        valid(sender);
        valid(recipient);
        holder(sender);
        holder(recipient);
    }

    function _isTrade(address _from, address _to) private view returns (bool) {
        return pair == _from || pair == _to;
    }

    function _isStartTrade(
        address _from,
        address _to
    ) private view returns (bool) {
        return
            tradeStartTime <= block.timestamp ||
            (_from != pair && _to != pair) ||
            (_isExcludedFromFees[_to] || _isExcludedFromFees[_from]);
    }

    function _shouldTakeFee(
        address from,
        address to
    ) private view returns (bool) {
        return
            !(_isExcludedFromFees[from] ||
                _isExcludedFromFees[to] ||
                NO_FEE_REQUIREMENT <= holderCount ||
                _swapping);
    }

    function _shouldTakeExtraFee() private view returns (bool) {
        uint256 time = block.timestamp;
        return tradeStartTime <= time && tradeStartTime.add(5 minutes) >= time;
    }

    function _shouldRebase() private view returns (bool) {
        return
            (_totalSupply < MAX_SUPPLY) &&
            msg.sender != pair &&
            !_swapping &&
            block.timestamp >= (_lastRebasedTime + rebaseInterval);
    }

    function _shouldSwap(
        address _from,
        address _to
    ) private view returns (bool) {
        return
            !_swapping &&
            _from != pair &&
            _from != owner() &&
            _to != owner() &&
            block.timestamp >= (_lastSwapTime + swapInterval);
    }

    function _takeFee(
        address sender,
        address recipient,
        uint256 gonAmount
    ) private returns (uint256 result) {
        result = gonAmount;

        //Extra
        if (_shouldTakeExtraFee()) {
            uint256 EFee = gonAmount.mul(extraFeeRate).div(1000);
            EFee > 0 && _basicTransfer(sender, extraWallet, EFee);
            result = result.sub(EFee);
        }
        if (!_isTrade(sender, recipient)) {
            //Burn
            uint256 BFee = gonAmount.mul(transferBurnFeeRate).div(1000);
            BFee > 0 && _basicTransfer(sender, DEAD, BFee);
            result = result.sub(BFee);
        } else {
            //LP
            uint256 LFee = gonAmount.mul(lpFeeRate).div(1000);
            gonsLpFee = gonsLpFee.add(LFee);
            LFee > 0 && _basicTransfer(sender, address(this), LFee);
            result = result.sub(LFee);

            //Burn
            uint256 BFee = gonAmount.mul(burnFeeRate).div(1000);
            BFee > 0 && _basicTransfer(sender, DEAD, BFee);
            result = result.sub(BFee);

            //Referral
            address[] memory parents = getParents(
                sender == pair ? recipient : sender,
                referralFeeRates.length
            );
            address burnWallet = pair == sender
                ? buyBurnWallet
                : sellBurnWallet;
            for (uint256 i = 0; i < parents.length; i++) {
                address parent = parents[i];
                uint256 RFee = gonAmount.mul(referralFeeRates[i]).div(1000);
                RFee > 0 &&
                    _basicTransfer(
                        sender,
                        parent == address(0) ||
                            !(isExcludedFromFees(parent) ||
                                i == 0 ||
                                validReferralCount(parent) >= 1 + i)
                            ? burnWallet
                            : parent,
                        RFee
                    );
                result = result.sub(RFee);
            }
        }
    }

    function _gonsBalanceOf(address _address) private view returns (uint256) {
        return _gonsBalances[_address];
    }

    function _rebase() private {
        uint256 deltaTime = block.timestamp - _lastRebasedTime;
        uint256 times = deltaTime.div(rebaseInterval);
        uint256 epoch = times.mul(rebaseInterval).div(1 minutes);
        for (uint256 i = 0; i < times; i++) {
            _totalSupply = _totalSupply
                .mul((10 ** decimals()).add(rebaseRate))
                .div(10 ** decimals());
            if (_totalSupply > MAX_SUPPLY) {
                _totalSupply = MAX_SUPPLY;
            }
        }
        _gonsPerFragment = TOTAL_GONS.div(_totalSupply);
        _lastRebasedTime = _lastRebasedTime.add(times.mul(rebaseInterval));
        emit LogRebase(epoch, _totalSupply);
    }

    function _swap() private {
        _swapping = true;
        if (gonsLpFee > 0) {
            _swapAndLiquidity(gonsLpFee.div(_gonsPerFragment));
            gonsLpFee = 0;
        }
        _lastSwapTime = block.timestamp;
        _swapping = false;
    }

    function _bindParent(address _parent, address _user) private {
        _referrals[_user] = _parent;
        _referralCounts[_parent]++;
        emit BindParent(_parent, _user);
    }

    function _referral(address _parent, address _user) private {
        if (isBindParent(_user) || !isBindParent(_parent)) {
            return;
        }
        _wReferrals[_user] = _parent;
    }

    function _acceptReferral(address _user, address _parent) private {
        address parent = _wReferrals[_user];
        if (parent != _parent) {
            return;
        }
        _wReferrals[_user] = address(0);
        _bindParent(parent, _user);
    }

    function _swapTokensForUsdt(
        uint256 tokenAmount
    ) private returns (uint256 swapUsdtAmount) {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = address(usdt);
        uint256 beforeUsdtAmount = usdt.balanceOf(address(wrap));
        pancakeSwapRouter.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(wrap),
            block.timestamp
        );
        uint256 afterUsdtAmount = usdt.balanceOf(address(wrap));
        wrap.withdraw();
        swapUsdtAmount = afterUsdtAmount.sub(beforeUsdtAmount);
    }

    function _swapAndLiquidity(uint256 tokenAmount) private {
        uint256 half = tokenAmount.div(2);
        uint256 otherHalf = tokenAmount.sub(half);
        uint256 usdtAmount = _swapTokensForUsdt(half);
        _addLiquidityUsdt(otherHalf, usdtAmount);
        emit SwapAndLiquify(half, usdtAmount, otherHalf);
    }

    function _addLiquidityUsdt(
        uint256 tokenAmount,
        uint256 usdtAmount
    ) private {
        pancakeSwapRouter.addLiquidity(
            address(this),
            address(usdt),
            tokenAmount,
            usdtAmount,
            0,
            0,
            DEAD,
            block.timestamp
        );
    }

    function setSwapInterval(uint256 _swapInterval) external onlyOwner {
        swapInterval = _swapInterval;
    }

    function setSellBurnWallet(address wallet) external onlyOwner {
        sellBurnWallet = wallet;
    }

    function setBuyBurnWallet(address wallet) external onlyOwner {
        buyBurnWallet = wallet;
    }

    function setExtraWallet(address wallet) external onlyOwner {
        extraWallet = wallet;
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        if (_isExcludedFromFees[account] != excluded) {
            _isExcludedFromFees[account] = excluded;
            emit ExcludeFromFees(account, excluded);
        }
    }

    function excludeMultipleAccountsFromFees(
        address[] calldata accounts,
        bool excluded
    ) external onlyOwner {
        for (uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }
        emit ExcludeMultipleAccountsFromFees(accounts, excluded);
    }

    function valid(address _account) public {
        if (!isBindParent(_account)) return;
        uint256 balance = balanceOf(_account);
        bool isVal = isValid(_account);
        if (isVal && balance < VALID_REQUIRE) {
            _isValids[_account] = false;
            _validReferralCounts[getParent(_account)] -= 1;
            return;
        }
        if (!isVal && balance >= VALID_REQUIRE) {
            _isValids[_account] = true;
            _validReferralCounts[getParent(_account)] += 1;
        }
    }

    function holder(address _address) public {
        uint256 balance = balanceOf(_address);
        bool isHolder = _isHolders[_address];
        if (isHolder && balance <= 0) {
            _isHolders[_address] = false;
            holderCount -= 1;
        }
        if (!isHolder && balance > 0) {
            _isHolders[_address] = true;
            holderCount += 1;
        }
    }

    function manualSync() external {
        IUniswapV2Pair(pair).sync();
    }

    function manualRebase() external {
        if (_shouldRebase()) {
            _rebase();
        }
    }

    function withdraw(address _token) external {
        if (_token == address(0x0)) {
            payable(rootAddress).transfer(address(this).balance);
        } else {
            IERC20(_token).transfer(
                rootAddress,
                IERC20(_token).balanceOf(address(this))
            );
        }
    }

    event LogRebase(uint256 indexed epoch, uint256 totalSupply);
    event ExcludeFromFees(address indexed account, bool isExcluded);
    event ExcludeMultipleAccountsFromFees(address[] accounts, bool isExcluded);
    event BindParent(address indexed parent, address indexed user);
    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 usdtReceived,
        uint256 tokensIntoLiqudity
    );
}
